/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<${scopeTag("ui5-responsive-popover", tags, suffix)} id="${ifDefined(context._id)}-overflowMenu" horizontal-align="Right" placement-type="Bottom" content-only-on-desktop with-padding hide-arrow _hide-header class="ui5-tab-container-responsive-popover"><${scopeTag("ui5-list", tags, suffix)} @ui5-item-press="${ifDefined(context._onOverflowListItemSelect)}">${ repeat(context.items, (item, index) => item._id || index, (item, index) => block1(item, index, context, tags, suffix)) }</${scopeTag("ui5-list", tags, suffix)}><div slot="footer" class="ui5-responsive-popover-footer"><${scopeTag("ui5-button", tags, suffix)} design="Transparent" @click="${context._closeRespPopover}">Cancel</${scopeTag("ui5-button", tags, suffix)}></div></${scopeTag("ui5-responsive-popover", tags, suffix)}>`;
const block1 = (item, index, context, tags, suffix) => html`${ !item.isSeparator ? block2(item, index, context, tags, suffix) : undefined }`;
const block2 = (item, index, context, tags, suffix) => html`${ifDefined(item.overflowPresentation)}`;


export default block0;
